(384, 1, '2022-06-16 04:19:30', '2022-06-16 04:19:30', 'The carousel is a slideshow for cycling through a series of content, built with CSS 3D transforms and a bit of JavaScript. It works with a series of images, text, or custom markup. It also includes support for previous/next controls and indicators. anisha\r\n\r\nIn browsers where the <a href=\"https://www.w3.org/TR/page-visibility/\">Page Visibility API</a> is supported, the carousel will avoid sliding when the webpage is not visible to the user (such as when the browser tab is inactive, the browser window is minimized, etc.).\r\n<div class=\"bd-callout bd-callout-info\">\r\n\r\nThe animation effect of this component is dependent on the <code class=\"highlighter-rouge\">prefers-reduced-motion</code> media query. See the <a href=\"https://getbootstrap.com/docs/4.3/getting-started/accessibility/#reduced-motion\">reduced motion section of our accessibility documentation</a>.\r\n\r\n</div>\r\nPlease be aware that nested carousels are not supported, and carousels are generally not compliant with accessibility standards.\r\n\r\nLastly, if you’re building our JavaScript from source, it <a href=\"https://getbootstrap.com/docs/4.3/getting-started/javascript/#util\">requires <code class=\"highlighter-rouge\">util.js</code></a>.\r\n<h2 id=\"example\"></h2>\r\n<img class=\"alignnone size-full wp-image-351\" src=\"http://localhost/wp_dev/wp-content/uploads/2022/06/f8bc6d71-f127-358c-a11d-233670400eb0.jpg\" alt=\"\" width=\"1175\" height=\"783\" />\r\n<h2 id=\"example\"><span class=\"bd-content-title\">Example</span></h2>\r\nCarousels don’t automatically normalize slide dimensions. As such, you may need to use additional utilities or custom styles to appropriately size content. While carousels support previous/next controls and indicators, they’re not explicitly required. Add and customize as you see fit.\r\n\r\n<strong>The <code class=\"highlighter-rouge\">.active</code> class needs to be added to one of the slides</strong> otherwise the carousel will not be visible. Also be sure to set a unique id on the <code class=\"highlighter-rouge\">.carousel</code> for optional controls, especially if you’re using multiple carousels on a single page. Control and indicator elements must have a <code class=\"highlighter-rouge\">data-target</code> attribute (or <code class=\"highlighter-rouge\">href</code> for links) that matches the id of the <code class=\"highlighter-rouge\">.carousel</code> element.\r\n<h3 id=\"slides-only\"><span class=\"bd-content-title\">Slides only</span></h3>\r\nHere’s a carousel with slides only. Note the presence of the <code class=\"highlighter-rouge\">.d-block</code> and <code class=\"highlighter-rouge\">.w-100</code> on carousel images to prevent browser default image alignment.\r\n<div class=\"bd-example\">\r\n<div id=\"carouselExampleSlidesOnly\" class=\"carousel slide\" data-ride=\"carousel\">\r\n<div class=\"carousel-inner\">\r\n<div class=\"carousel-item active\">Second slide</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"bd-clipboard\"><button class=\"btn-clipboard\" title=\"\" type=\"button\" data-original-title=\"Copy to clipboard\">Copy</button></div>\r\n<div></div>\r\n<div></div>\r\n<div></div>\r\n<div>\r\n<pre><span style=\"color: #222222; font-family: monospace;\"><span style=\"background-color: #e9ebec;\">&lt;code&gt;\r\n<code class=\"language-html\" data-lang=\"html\"><span class=\"nt\">&lt;div</span> <span class=\"na\">id=</span><span class=\"s\">\"carouselExampleSlidesOnly\"</span> <span class=\"na\">class=</span><span class=\"s\">\"carousel slide\"</span> <span class=\"na\">data-ride=</span><span class=\"s\">\"carousel\"</span><span class=\"nt\">&gt;</span>\r\n  <span class=\"nt\">&lt;div</span> <span class=\"na\">class=</span><span class=\"s\">\"carousel-inner\"</span><span class=\"nt\">&gt;</span>\r\n    <span class=\"nt\">&lt;div</span> <span class=\"na\">class=</span><span class=\"s\">\"carousel-item active\"</span><span class=\"nt\">&gt;</span>\r\n        <span class=\"nt\">&lt;img</span> <span class=\"na\">src=</span><span class=\"s\">\"...\"</span> <span class=\"na\">class=</span><span class=\"s\">\"d-block w-100\"</span> <span class=\"na\">alt=</span><span class=\"s\">\"...\"</span><span class=\"nt\">&gt;</span>\r\n    <span class=\"nt\">&lt;/div&gt;</span>\r\n    <span class=\"nt\">&lt;div</span> <span class=\"na\">class=</span><span class=\"s\">\"carousel-item\"</span><span class=\"nt\">&gt;</span>\r\n      <span class=\"nt\">&lt;img</span> <span class=\"na\">src=</span><span class=\"s\">\"...\"</span> <span class=\"na\">class=</span><span class=\"s\">\"d-block w-100\"</span> <span class=\"na\">alt=</span><span class=\"s\">\"...\"</span><span class=\"nt\">&gt;</span>\r\n    <span class=\"nt\">&lt;/div&gt;</span>\r\n    <span class=\"nt\">&lt;div</span> <span class=\"na\">class=</span><span class=\"s\">\"carousel-item\"</span><span class=\"nt\">&gt;</span>\r\n      <span class=\"nt\">&lt;img</span> <span class=\"na\">src=</span><span class=\"s\">\"...\"</span> <span class=\"na\">class=</span><span class=\"s\">\"d-block w-100\"</span> <span class=\"na\">alt=</span><span class=\"s\">\"...\"</span><span class=\"nt\">&gt;</span>\r\n    <span class=\"nt\">&lt;/div&gt;</span>\r\n  <span class=\"nt\">&lt;/div&gt;</span>\r\n<span class=\"nt\">&lt;/div&gt;</span></code> &lt;/code</span></span></pre>\r\n</div>', 'Carousel  - How it works?', '', 'inherit', 'closed', 'closed', '', '378-revision-v1', '', '', '2022-06-16 04:19:30', '2022-06-16 04:19:30', '', 378, 'http://localhost/wp_dev/?p=384', 0, 'revision', '', 0),
