(390, 5, '2022-06-18 01:01:22', '2022-06-18 01:01:22', 'WordPress displays comments in your theme based on the settings and code in the <code>comments.php</code> file within your WordPress theme.\r\n<h2 id=\"simple-comments-loop\" class=\"toc-heading\" tabindex=\"-1\"><a class=\"dashicons-before dashicons-admin-links\" href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#simple-comments-loop\">Simple comments loop</a></h2>\r\n<div class=\"wp-block-syntaxhighlighter-code \"><section class=\"source-content\">\r\n<div class=\"source-code-container\">\r\n<div>\r\n<div id=\"highlighter_357084\" class=\"syntaxhighlighter php \">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div>\r\n<div class=\"line number5 index4 alt2\">5</div>\r\n<div class=\"line number6 index5 alt1\">6</div>\r\n<div class=\"line number7 index6 alt2\">7</div>\r\n<div class=\"line number8 index7 alt1\">8</div>\r\n<div class=\"line number9 index8 alt2\">9</div>\r\n<div class=\"line number10 index9 alt1\">10</div>\r\n<div class=\"line number11 index10 alt2\">11</div>\r\n<div class=\"line number12 index11 alt1\">12</div>\r\n<div class=\"line number13 index12 alt2\">13</div>\r\n<div class=\"line number14 index13 alt1\">14</div>\r\n<div class=\"line number15 index14 alt2\">15</div>\r\n<div class=\"line number16 index15 alt1\">16</div>\r\n<div class=\"line number17 index16 alt2\">17</div></td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"php comments\">//Get only the approved comments</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"php variable\">$args</code> <code class=\"php plain\">= </code><code class=\"php keyword\">array</code><code class=\"php plain\">(</code></div>\r\n<div class=\"line number3 index2 alt2\"><code class=\"php spaces\">    </code><code class=\"php string\">\'status\'</code> <code class=\"php plain\">=&gt; </code><code class=\"php string\">\'approve\'</code></div>\r\n<div class=\"line number4 index3 alt1\"><code class=\"php plain\">);</code></div>\r\n<div class=\"line number5 index4 alt2\"></div>\r\n<div class=\"line number6 index5 alt1\"><code class=\"php comments\">// The comment Query</code></div>\r\n<div class=\"line number7 index6 alt2\"><code class=\"php variable\">$comments_query</code> <code class=\"php plain\">= </code><code class=\"php keyword\">new</code> <code class=\"php plain\">WP_Comment_Query;</code></div>\r\n<div class=\"line number8 index7 alt1\"><code class=\"php variable\">$comments</code> <code class=\"php plain\">= </code><code class=\"php variable\">$comments_query</code><code class=\"php plain\">-&gt;query( </code><code class=\"php variable\">$args</code> <code class=\"php plain\">);</code></div>\r\n<div class=\"line number9 index8 alt2\"></div>\r\n<div class=\"line number10 index9 alt1\"><code class=\"php comments\">// Comment Loop</code></div>\r\n<div class=\"line number11 index10 alt2\"><code class=\"php keyword\">if</code> <code class=\"php plain\">( </code><code class=\"php variable\">$comments</code> <code class=\"php plain\">) {</code></div>\r\n<div class=\"line number12 index11 alt1\"><code class=\"php spaces\"> </code><code class=\"php keyword\">foreach</code> <code class=\"php plain\">( </code><code class=\"php variable\">$comments</code> <code class=\"php keyword\">as</code> <code class=\"php variable\">$comment</code> <code class=\"php plain\">) {</code></div>\r\n<div class=\"line number13 index12 alt2\"><code class=\"php spaces\"> </code><code class=\"php functions\">echo</code> <code class=\"php string\">\'&lt;p&gt;\'</code> <code class=\"php plain\">. </code><code class=\"php variable\">$comment</code><code class=\"php plain\">-&gt;comment_content . </code><code class=\"php string\">\'&lt;/p&gt;\'</code><code class=\"php plain\">;</code></div>\r\n<div class=\"line number14 index13 alt1\"><code class=\"php spaces\"> </code><code class=\"php plain\">}</code></div>\r\n<div class=\"line number15 index14 alt2\"><code class=\"php plain\">} </code><code class=\"php keyword\">else</code> <code class=\"php plain\">{</code></div>\r\n<div class=\"line number16 index15 alt1\"><code class=\"php spaces\"> </code><code class=\"php functions\">echo</code> <code class=\"php string\">\'No comments found.\'</code><code class=\"php plain\">;</code></div>\r\n<div class=\"line number17 index16 alt2\"><code class=\"php plain\">}</code></div>\r\n</div></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p class=\"source-code-links\"><a class=\"less-complete-source\" href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#\">Collapse full source code</a></p>\r\n\r\n</section></div>\r\nThe <code>comments.php</code> template contains all the logic needed to pull comments out of the database and display them in your theme.\r\n\r\nBefore we explore the template file you’ll want to know how to pull in the partial template file on the appropriate pages such as <code>single.php</code>. You’ll wrap the comment <a href=\"https://developer.wordpress.org/themes/basics/template-tags/\">template tag</a> in a conditional statement so comments.php is only pulled in if it makes sense to do.\r\n<div class=\"wp-block-syntaxhighlighter-code \">\r\n<div>\r\n<div id=\"highlighter_94853\" class=\"syntaxhighlighter php\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div></td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"php comments\">// If comments are open or we have at least one comment, load up the comment template.</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"php spaces\"> </code><code class=\"php keyword\">if</code> <code class=\"php plain\">( comments_open() || get_comments_number() ) :</code></div>\r\n<div class=\"line number3 index2 alt2\"><code class=\"php spaces\">     </code><code class=\"php plain\">comments_template();</code></div>\r\n<div class=\"line number4 index3 alt1\"><code class=\"php spaces\"> </code><code class=\"php keyword\">endif</code><code class=\"php plain\">;</code></div>\r\n</div></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<figure class=\"wp-block-image\"><img class=\"wp-image-11358\" src=\"https://developer.wordpress.org/files/2014/10/functionality-comments-01.png\" sizes=\"(max-width: 350px) 100vw, 350px\" srcset=\"https://developer.wordpress.org/files/2014/10/functionality-comments-01.png 350w, https://developer.wordpress.org/files/2014/10/functionality-comments-01-300x220.png 300w\" alt=\"functionality-comments-01\" width=\"350\" height=\"257\" /></figure>\r\n<p class=\"toc-jump\"><a href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#top\">Top ↑</a></p>\r\n\r\n<h2 id=\"another-comments-php-example\" class=\"toc-heading\" tabindex=\"-1\"><a class=\"dashicons-before dashicons-admin-links\" href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#another-comments-php-example\">Another Comments.php Example</a></h2>\r\nHere’s an example of the <code>comments.php</code> template included with the Twenty Thirteen theme:\r\n<div class=\"wp-block-syntaxhighlighter-code \"><section class=\"source-content\">\r\n<div class=\"source-code-container\">\r\n<div>\r\n<div id=\"highlighter_819961\" class=\"syntaxhighlighter php \">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div>\r\n<div class=\"line number5 index4 alt2\">5</div>\r\n<div class=\"line number6 index5 alt1\">6</div>\r\n<div class=\"line number7 index6 alt2\">7</div>\r\n<div class=\"line number8 index7 alt1\">8</div>\r\n<div class=\"line number9 index8 alt2\">9</div>\r\n<div class=\"line number10 index9 alt1\">10</div>\r\n<div class=\"line number11 index10 alt2\">11</div>\r\n<div class=\"line number12 index11 alt1\">12</div>\r\n<div class=\"line number13 index12 alt2\">13</div>\r\n<div class=\"line number14 index13 alt1\">14</div>\r\n<div class=\"line number15 index14 alt2\">15</div>\r\n<div class=\"line number16 index15 alt1\">16</div>\r\n<div class=\"line number17 index16 alt2\">17</div>\r\n<div class=\"line number18 index17 alt1\">18</div>\r\n<div class=\"line number19 index18 alt2\">19</div>\r\n<div class=\"line number20 index19 alt1\">20</div>\r\n<div class=\"line number21 index20 alt2\">21</div>\r\n<div class=\"line number22 index21 alt1\">22</div>\r\n<div class=\"line number23 index22 alt2\">23</div>\r\n<div class=\"line number24 index23 alt1\">24</div>\r\n<div class=\"line number25 index24 alt2\">25</div>\r\n<div class=\"line number26 index25 alt1\">26</div>\r\n<div class=\"line number27 index26 alt2\">27</div>\r\n<div class=\"line number28 index27 alt1\">28</div>\r\n<div class=\"line number29 index28 alt2\">29</div>\r\n<div class=\"line number30 index29 alt1\">30</div>\r\n<div class=\"line number31 index30 alt2\">31</div>\r\n<div class=\"line number32 index31 alt1\">32</div>\r\n<div class=\"line number33 index32 alt2\">33</div>\r\n<div class=\"line number34 index33 alt1\">34</div>\r\n<div class=\"line number35 index34 alt2\">35</div>\r\n<div class=\"line number36 index35 alt1\">36</div>\r\n<div class=\"line number37 index36 alt2\">37</div>\r\n<div class=\"line number38 index37 alt1\">38</div>\r\n<div class=\"line number39 index38 alt2\">39</div>\r\n<div class=\"line number40 index39 alt1\">40</div>\r\n<div class=\"line number41 index40 alt2\">41</div>\r\n<div class=\"line number42 index41 alt1\">42</div>\r\n<div class=\"line number43 index42 alt2\">43</div>\r\n<div class=\"line number44 index43 alt1\">44</div>\r\n<div class=\"line number45 index44 alt2\">45</div>\r\n<div class=\"line number46 index45 alt1\">46</div>\r\n<div class=\"line number47 index46 alt2\">47</div>\r\n<div class=\"line number48 index47 alt1\">48</div>\r\n<div class=\"line number49 index48 alt2\">49</div>\r\n<div class=\"line number50 index49 alt1\">50</div>\r\n<div class=\"line number51 index50 alt2\">51</div>\r\n<div class=\"line number52 index51 alt1\">52</div>\r\n<div class=\"line number53 index52 alt2\">53</div>\r\n<div class=\"line number54 index53 alt1\">54</div>\r\n<div class=\"line number55 index54 alt2\">55</div>\r\n<div class=\"line number56 index55 alt1\">56</div>\r\n<div class=\"line number57 index56 alt2\">57</div>\r\n<div class=\"line number58 index57 alt1\">58</div>\r\n<div class=\"line number59 index58 alt2\">59</div></td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"php plain\">&lt;?php</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"php comments\">/**</code></div>\r\n<div class=\"line number3 index2 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">* The template for displaying Comments.</code></div>\r\n<div class=\"line number4 index3 alt1\"><code class=\"php spaces\"> </code><code class=\"php comments\">*</code></div>\r\n<div class=\"line number5 index4 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">* The area of the page that contains comments and the comment form.</code></div>\r\n<div class=\"line number6 index5 alt1\"><code class=\"php spaces\"> </code><code class=\"php comments\">*</code></div>\r\n<div class=\"line number7 index6 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">* @package WordPress</code></div>\r\n<div class=\"line number8 index7 alt1\"><code class=\"php spaces\"> </code><code class=\"php comments\">* @subpackage Twenty_Thirteen</code></div>\r\n<div class=\"line number9 index8 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">* @since Twenty Thirteen 1.0</code></div>\r\n<div class=\"line number10 index9 alt1\"><code class=\"php spaces\"> </code><code class=\"php comments\">*/</code></div>\r\n<div class=\"line number11 index10 alt2\"></div>\r\n<div class=\"line number12 index11 alt1\"><code class=\"php comments\">/*</code></div>\r\n<div class=\"line number13 index12 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">* If the current post is protected by a password and the visitor has not yet</code></div>\r\n<div class=\"line number14 index13 alt1\"><code class=\"php spaces\"> </code><code class=\"php comments\">* entered the password we will return early without loading the comments.</code></div>\r\n<div class=\"line number15 index14 alt2\"><code class=\"php spaces\"> </code><code class=\"php comments\">*/</code></div>\r\n<div class=\"line number16 index15 alt1\"><code class=\"php keyword\">if</code> <code class=\"php plain\">( post_password_required() )</code></div>\r\n<div class=\"line number17 index16 alt2\"><code class=\"php spaces\">    </code><code class=\"php keyword\">return</code><code class=\"php plain\">;</code></div>\r\n<div class=\"line number18 index17 alt1\"><code class=\"php plain\">?&gt;</code></div>\r\n<div class=\"line number19 index18 alt2\"></div>\r\n<div class=\"line number20 index19 alt1\"><code class=\"php plain\">&lt;div id=</code><code class=\"php string\">\"comments\"</code> <code class=\"php keyword\">class</code><code class=\"php plain\">=</code><code class=\"php string\">\"comments-area\"</code><code class=\"php plain\">&gt;</code></div>\r\n<div class=\"line number21 index20 alt2\"></div>\r\n<div class=\"line number22 index21 alt1\"><code class=\"php spaces\">    </code><code class=\"php plain\">&lt;?php </code><code class=\"php keyword\">if</code> <code class=\"php plain\">( have_comments() ) : ?&gt;</code></div>\r\n<div class=\"line number23 index22 alt2\"><code class=\"php spaces\">        </code><code class=\"php plain\">&lt;h2 </code><code class=\"php keyword\">class</code><code class=\"php plain\">=</code><code class=\"php string\">\"comments-title\"</code><code class=\"php plain\">&gt;</code></div>\r\n<div class=\"line number24 index23 alt1\"><code class=\"php spaces\">            </code><code class=\"php plain\">&lt;?php</code></div>\r\n<div class=\"line number25 index24 alt2\"><code class=\"php spaces\">                </code><code class=\"php plain\">printf( _nx( </code><code class=\"php string\">\'One thought on \"%2$s\"\'</code><code class=\"php plain\">, </code><code class=\"php string\">\'%1$s thoughts on \"%2$s\"\'</code><code class=\"php plain\">, get_comments_number(), </code><code class=\"php string\">\'comments title\'</code><code class=\"php plain\">, </code><code class=\"php string\">\'twentythirteen\'</code> <code class=\"php plain\">),</code></div>\r\n<div class=\"line number26 index25 alt1\"><code class=\"php spaces\">                    </code><code class=\"php plain\">number_format_i18n( get_comments_number() ), </code><code class=\"php string\">\'&lt;span&gt;\'</code> <code class=\"php plain\">. get_the_title() . </code><code class=\"php string\">\'&lt;/span&gt;\'</code> <code class=\"php plain\">);</code></div>\r\n<div class=\"line number27 index26 alt2\"><code class=\"php spaces\">            </code><code class=\"php plain\">?&gt;</code></div>\r\n<div class=\"line number28 index27 alt1\"><code class=\"php spaces\">        </code><code class=\"php plain\">&lt;/h2&gt;</code></div>\r\n<div class=\"line number29 index28 alt2\"></div>\r\n<div class=\"line number30 index29 alt1\"><code class=\"php spaces\">        </code><code class=\"php plain\">&lt;ol </code><code class=\"php keyword\">class</code><code class=\"php plain\">=</code><code class=\"php string\">\"comment-list\"</code><code class=\"php plain\">&gt;</code></div>\r\n<div class=\"line number31 index30 alt2\"><code class=\"php spaces\">            </code><code class=\"php plain\">&lt;?php</code></div>\r\n<div class=\"line number32 index31 alt1\"><code class=\"php spaces\">                </code><code class=\"php plain\">wp_list_comments( </code><code class=\"php keyword\">array</code><code class=\"php plain\">(</code></div>\r\n<div class=\"line number33 index32 alt2\"><code class=\"php spaces\">                    </code><code class=\"php string\">\'style\'</code>       <code class=\"php plain\">=&gt; </code><code class=\"php string\">\'ol\'</code><code class=\"php plain\">,</code></div>\r\n<div class=\"line number34 index33 alt1\"><code class=\"php spaces\">                    </code><code class=\"php string\">\'short_ping\'</code>  <code class=\"php plain\">=&gt; true,</code></div>\r\n<div class=\"line number35 index34 alt2\"><code class=\"php spaces\">                    </code><code class=\"php string\">\'avatar_size\'</code> <code class=\"php plain\">=&gt; 74,</code></div>\r\n<div class=\"line number36 index35 alt1\"><code class=\"php spaces\">                </code><code class=\"php plain\">) );</code></div>\r\n<div class=\"line number37 index36 alt2\"><code class=\"php spaces\">            </code><code class=\"php plain\">?&gt;</code></div>\r\n<div class=\"line number38 index37 alt1\"><code class=\"php spaces\">        </code><code class=\"php plain\">&lt;/ol&gt;&lt;!-- .comment-list --&gt;</code></div>\r\n<div class=\"line number39 index38 alt2\"></div>\r\n<div class=\"line number40 index39 alt1\"><code class