(391, 5, '2022-06-18 01:01:22', '2022-06-18 01:01:22', 'WordPress displays comments in your theme based on the settings and code in the <code>comments.php</code> file within your WordPress theme.\r\n<h2 id=\"simple-comments-loop\" class=\"toc-heading\" tabindex=\"-1\"><a class=\"dashicons-before dashicons-admin-links\" href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#simple-comments-loop\">Simple comments loop</a></h2>\r\n<div class=\"wp-block-syntaxhighlighter-code \"><section class=\"source-content\">\r\n<div class=\"source-code-container\">\r\n<div>\r\n<div id=\"highlighter_357084\" class=\"syntaxhighlighter  php \">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div>\r\n<div class=\"line number5 index4 alt2\">5</div>\r\n<div class=\"line number6 index5 alt1\">6</div>\r\n<div class=\"line number7 index6 alt2\">7</div>\r\n<div class=\"line number8 index7 alt1\">8</div>\r\n<div class=\"line number9 index8 alt2\">9</div>\r\n<div class=\"line number10 index9 alt1\">10</div>\r\n<div class=\"line number11 index10 alt2\">11</div>\r\n<div class=\"line number12 index11 alt1\">12</div>\r\n<div class=\"line number13 index12 alt2\">13</div>\r\n<div class=\"line number14 index13 alt1\">14</div>\r\n<div class=\"line number15 index14 alt2\">15</div>\r\n<div class=\"line number16 index15 alt1\">16</div>\r\n<div class=\"line number17 index16 alt2\">17</div></td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"php comments\">//Get only the approved comments</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"php variable\">$args</code> <code class=\"php plain\">= </code><cod