de><code class=\"php plain\">-&gt;comment_content . </code><code class=\"php string\">\'&lt;/p&gt;\'</code><code class=\"php plain\">;</code></div>\r\n<div class=\"line number14 index13 alt1\"><code class=\"php spaces\"> </code><code class=\"php plain\">}</code></div>\r\n<div class=\"line number15 index14 alt2\"><code class=\"php plain\">} </code><code class=\"php keyword\">else</code> <code class=\"php plain\">{</code></div>\r\n<div class=\"line number16 index15 alt1\"><code class=\"php spaces\"> </code><code class=\"php functions\">echo</code> <code class=\"php string\">\'No comments found.\'</code><code class=\"php plain\">;</code></div>\r\n<div class=\"line number17 index16 alt2\"><code class=\"php plain\">}</code></div>\r\n</div></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p class=\"source-code-links\"><a class=\"less-complete-source\" href=\"https://developer.wordpress.org/themes/template-files-section/partial-and-miscellaneous-template-files/comment-template/#\">Collapse full source code</a></p>\r\n\r\n</section></div>\r\nThe <code>comments.php</code> template contains all the logic needed to pull comments out of the database and display them in your theme.\r\n\r\nBefore we explore the template file you’ll want to know how to pull in the partial template file on the appropriate pages such as <code>single.php</code>. You’ll wrap the comment <a href=\"https://developer.wordpress.org/themes/basics/template-tags/\">template tag</a> in a conditional statement so comments.php is only pulled in if it makes sense to do.\r\n<div class=\"wp-block-syntaxhighlighter-code \">\r\n<div>\r\n<div id=\"highlighter_94853\" class=\"syntaxhighlighter  php\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\"